<!DOCTYPE html>
<html lang="en">

<head>
    <style>
        /*
         * MAIN
         */
        
        main {
            position: relative;
            width: 80%;
            height: 100%;
            margin: auto;
        }
        
        main .dark {
            position: absolute;
            width: 100%;
            height: 100%;
            background-color: rgba(58, 58, 58, .9);
            z-index: 1;
            display: none;
        }
        /* 1. TXT - ZÁKLADNÉ INFORMÁCIE - Options */
        
        .right_txt {
            height: 100%;
            display: flex;
            justify-content: center;
            align-items: center;
        }
        
        .txt {
            position: absolute;
            width: 50%;
            left: 50%;
            color: #3DDC84;
        }
        
        .txt h1 {
            font-size: 200%;
            margin-bottom: 3%;
        }
        
        .txt h5 {
            font-size: 150%;
            margin: 5% 0 3%;
        }
        
        .txt p {
            font-size: 120%;
            color: whitesmoke;
            line-height: 200%;
        }
        
        .txt i {
            font-style: italic;
            color: #3DDC84;
        }
        
        .txt span {
            display: inline-block;
            position: relative;
            margin-top: 5%;
            padding-bottom: 1%;
            color: whitesmoke;
            border-bottom: 1px solid #3DDC84;
        }
        /* 2. TXT - JA & WEBDESIGN - Options */
        
        .txt_2 {
            position: absolute;
            width: 100%;
            left: 0;
            display: none;
        }
        /* 1. TXT - SVG - Options */
        
        .img {
            position: absolute;
            display: flex;
            justify-content: center;
            align-items: center;
            top: 5%;
            width: 50%;
            height: 100%;
        }
        
        .img svg {
            width: 80%;
        }
        /*
         * MEDIA Q. 
         */
        
        @media only screen and (max-width: 1000px) {
            main {
                width: 90%;
                height: auto;
                margin: 10% auto 10% auto;
                padding-bottom: 10%;
                text-align: center;
            }
            main .dark {
                display: block;
            }
            /* 1. TXT - ZÁKLADNÉ INFORMÁCIE */
            .right_txt {
                height: 100%;
            }
            .txt {
                position: relative;
                width: 100%;
                left: 0%;
                z-index: 1;
            }
            /* 2. TXT - JA & WEBDESIGN */
            /* 1. TXT - SVG */
            .img {
                width: 100%;
            }
            .img svg {
                width: 50%;
            }
        }
        
        @media only screen and (max-width: 600px) {
            .txt span {
                margin-top: 10%;
            }
            .img svg {
                width: 80%;
            }
        }
    </style>

</head>

<body>

    <main id="main">

        <!-- Zatmavenie pozadia pri responzivite -->
        <div class="dark"></div>

        <!-- 1. TXT - ZÁKLADNÉ INFORMÁCIE -->
        <div class="right_txt">

            <div class="txt" id="txt_1">

                <h1>ZÁKLADNÉ INFORMÁCIE</h1>

                <h5>O mne</h5>
                <p>
                    Moje meno je Šimon Marchevský a mám 20 rokov.
                </p>
                <p>
                    Vyštudoval som Strednú priemyselnú školu elektrotechnickú v Prešove v odbore INFORMAČNÉ A SIEŤOVÉ TECHNÓGIE.
                </p>

                <h5>Moje schopnosti</h5>
                <p>
                    Ovládam HTML5, CSS3, JS ( Aj jQuery ). Mám skúsenosti aj s Python a Git.
                </p>

                <span>Chceš o mne vedieť viac ?</span>

            </div>

            <!-- 2. TXT - JA A WEBDESIGN -->

            <div class="txt txt_2" id="txt_2">

                <h1>JA & WEBDESIGN</h1>

                <p>
                    Mojou najväčšou vášňou je práve webdesign ktorý ma nadchol už na strednej škole. Či už šlo o nejaký školský projekt alebo len pomoc s designom pre kamaráta dokázal som nad stánkou sedieť hodiny niekedy aj dni skúšaním najrôznejších kombinácií farieb,
                    fontov, animácií a prkov kým som nedosiahol výsledok ktorý som chcel. Vždy som sa rád naučil nejakú novú znalosť ktorá by ma v tomto dokázala posunúť ďalej. Toto je práve dôvod prečo som stvoril túto stránku na ktorej by som Vám rád
                    prezentoval moje schopnosti a získal tak možnosť pracovať v skutočnej firme.
                </p>
                <p>
                    Pracovať ako designer webových stránok sa za ten krátky čas stalo naozaj mojím snom pri ktorom môžem využiť svoju kreatyvitu a mám naozaj nekonečné množstvo možností ktorými sa pri ich tvorbe môžem vydať.
                </p>
                <p>
                    <i>Verím, že robiť v živote to čo nás baví je kľúčom k šťastiu</i> a práve toto je niečo čo ma za 20 rokov môjho života baví úplne najviac. Preto by som v tom chcel pokračovať a zdokonaľovať sa.
                </p>

                <span>Späť na pôvodnú stranu</span>

            </div>

        </div>

