    <script>
        'use strict';

        /*
         * Viac o mne
         */

        var main = document.getElementById('main'),
            spanLink = document.querySelectorAll('.txt span'),
            firstText = document.getElementById('txt_1'),
            secondText = document.getElementById('txt_2'),
            svgImg = document.getElementById('svg_img');

        let bool = new Boolean(true);

        spanLink.forEach(ele => {
            ele.addEventListener('click', () => {
                if (bool == true) {
                    firstText.style.display = 'none';
                    svgImg.style.display = 'none';

                    secondText.style.display = 'block';

                    bool = Boolean(false);
                } else {
                    firstText.style.display = 'block';
                    svgImg.style.display = 'flex';

                    secondText.style.display = 'none';

                    bool = Boolean(true);
                }
            });
        });

        spanLink.forEach(link => {
            link.addEventListener('mouseover', () => {
                mouseCursor.classList.add('mouse_over_link');
            });
            link.addEventListener('mouseleave', () => {
                mouseCursor.classList.remove('mouse_over_link');
            });
        });
    </script>

